                }
                if (TimeUnits3 != _TimeUnits3)
                {
                    if (TimeUnits3 > _TimeUnits3)
                    {
                        measurement = Time<T>.Table[(int)_TimeUnits3][(int)TimeUnits3](measurement);
                    }
                    else
                    {
                        measurement = Time<T>.Table[(int)TimeUnits3][(int)_TimeUnits3](measurement);
