			, Mass.Units fromMassUnits1
			, Length.Units fromLengthUnits2
			, Mass.Units toMassUnits1
			, Length.Units toLengthUnits2
			)
		{
			LinearDensity<T> measurement = new LinearDensity<T>(value
				, fromMassUnits1
				, fromLengthUnits2
				);
			return measurement[
				 toMassUnits1
				, toLengthUnits2
				];
		}

