        public Mass.Units MassUnits1
        {
            get { return _MassUnits1; }
            set
            {
                if (value != _MassUnits1)
                {
                    _measurement = this[value, _LengthUnits2];
                    _MassUnits1 = value;
                }
            }
        }

		/// <summary>The #2 component of this measurements units.</summary>
