			{
				throw new Exception("Bug in Towel. Invalid parameters to LinearMass Factory.");
			}
			if (!(units[0] is Mass.Units))
			{
				throw new Exception("Bug in Towel. Invalid parameters to LinearMass Factory.");
			}
			if (!(units[1] is Length.Units))
			{
				throw new Exception("Bug in Towel. Invalid parameters to LinearMass Factory.");
			}
			return new LinearMass<T>(value
				, (Mass.Units)units[0]
				, (Length.Units)units[1]
				);
		}
	}

