		public T this[Mass.Units MassUnits1, Time.Units TimeUnits2]
        {
            get
            {
                T measurement = _measurement;
                if (MassUnits1 != _MassUnits1)
                {
					measurement = Mass<T>.Table[(int)_MassUnits1][(int)MassUnits1](measurement);
                    //if (MassUnits1 < _MassUnits1)
