                }
                if (TimeUnits2 != _TimeUnits2)
                {
                    if (TimeUnits2 > _TimeUnits2)
                    {
                        measurement = Time<T>.Table[(int)_TimeUnits2][(int)TimeUnits2](measurement);
                    }
                    else
                    {
                        measurement = Time<T>.Table[(int)TimeUnits2][(int)_TimeUnits2](measurement);
