				throw new Exception("Bug in Towel. Invalid parameters to Time Factory.");
			}
			if (!(units[0] is Time.Units))
			{
				throw new Exception("Bug in Towel. Invalid parameters to Time Factory.");
			}
			return new Time<T>(value
				, (Time.Units)units[0]
				);
		}
	}

